    'sexualwarningbody.SexualWarning_02_Body': {value: '<p><strong>S klikom \xBBSprejemam pogoje in dolo\u010Dila ter \u017Eelim obiskati zasebne stike\xAB, potrjujem:</strong></p><ul><li>Star sem vsaj 18 let.</li><li>Zavedam se, da lahko <strong>Zasebni stiki</strong> vklju\u010Dujejo vsebine, povezane s seksualnostjo.</li><li>Strinjam se, da ne bom nalagal pornografskih fotografij, fotografij ali ilustracij ljudi, ki niso izrecno dali svojega privoljenja, fotografij ljudi, starih manj od 18 let, \u0161e posebej fotografij otrok.</li><li>Pri fotografijah bom spo\u0161toval zakon o lastninski pravici.</li><li>Ne bom objavljal oglasov s predlogi ali namigovanjem na seksualne usluge v zameno za pla\u010Dilo ali kakr\u0161no koli drugo vrsto nadomestila.</li><li>Strinjam se, da bom ozna\u010Dil z zastavico \xBBprepovedano\xAB katerikoli oglas, ki je nezakonit ali kako druga\u010De kr\u0161i <a href="%s" onclick="window.open(this.href); return false;"><strong>pogoje uporabe spletne strani OLX</strong></a> in se strinjam, da bom ustreznim organom prijavil vsak sum zlorabe mladoletnih oseb.</li><li>Razumem, da podjetje OLX ne more odgovarjati za nepravilno uporabo ponujenih storitev. Kr\u0161itev pogojev uporabe lahko vodi do takoj\u0161njega izbrisa va\u0161ega oglasa ali va\u0161ega ra\u010Duna in v kazenski pregon.</li></ul>', index: 1220},
