    'help.NewToBrand': {value: 'Novi na OLX', index: 4793},
    'help.PersonalTouch': {value: 'Vnesite svoje ime. S tem, da dodate nekaj osebnega, boste pritegnili ve\u010D odgovorov.', index: 4794},
    'help.PlsRemeberRules': {value: 'Prosimo, ne pozabite na na\u0161a pravila\u2026', index: 4795},
    'help.PostingBalloonTip_description_30_301': {value: 'Vnesite podrobnosti o va\u0161i nepremi\u010Dnini, kot npr. klimatizacija, omare, spredaj ali zadaj, dru\u017Eina, penzion.', index: 4796},
    'help.PostingBalloonTip_description_30_363': {value: 'Vnesite podrobnosti o va\u0161i nepremi\u010Dnini, kot npr. parkirna mesta,  bazen, \u0161tevilo kopalnic, ra\u017Eenj, balkon, blizu trgovin, \u0161ol, pekarn, lekarn.', index: 4797},
    'help.PostingBalloonTip_description_30_367': {value: 'Vnesite podrobnosti o va\u0161i nepremi\u010Dnini, kot so parkirna mesta, bazen, \u0161tevilo kopalnic, ra\u017Eenj, balkon, blizu trgovin, \u0161ol, pekarn, lekarn.', index: 4798},
