    'help.PostingBalloonTip_description_30_388': {value: 'Vnesite podrobnosti o va\u0161i nepremi\u010Dnini, kot je obdobje bivanja, \u0161tevilo kopalnic, ra\u017Eenj, balkon, parkirna mesta, lokacija (referen\u010Dna to\u010Dka).', index: 4804},
