    'help.PostingBalloonTip_description_30_416': {value: 'Vnesite podrobnosti, kot so elektri\u010Dna okna, alarm, stereo, DVD predvajalnik, zra\u010Dne blazine, gorivo, stanje vzdr\u017Eevanja, klimatizacija.', index: 4807},
    'help.PostingBalloonTip_description_99_366': {value: 'Malo poropotajte tukaj, da prodrete skozi nered in ustvarite dobre pogoje za svoj predmet s tem, da mu daste opis, dolg vsaj 150 besed, in z nekaj fotografijami, s \u010Dimer ga boste naredili za "edino izbiro" pri kupcih.', index: 4808},
    'help.PostingBalloonTip_description_99_367': {value: 'Naredite svojo lastnino za VRO\u010C NAKUP, napi\u0161ite podroben opis, dolg vsaj 150 besed, ki bo natan\u010Dno navedel edinstvene prodajne to\u010Dke va\u0161ega stanovanja/zemlji\u0161\u010Da, kot so skupna povr\u0161ina, \u0161tevilo sob, kopalnic, balkonov, ali je opremljeno/delno opremljeno, novo/staro, ali morda blizu nakupovalnega sredi\u0161\u010Da/parka/\u0161ole/bolni\u0161nice/avtobusnega postajali\u0161\u010Da/metro postaje ipd. Dodajte fotografije, da izbolj\u0161ate odziv na oglas.', index: 4809},
    'help.PostingBalloonTip_description_99_378': {value: 'Svoje vozilo opi\u0161ite tako, da bo kupec hrepenel po njem in se mu bodo ob specifikacijah cedile sline. Uporabite ve\u010D fotografij z vsaj 150 besedami, in kupcu povejte, kako zelo ste ljubili svojo dragoceno lastnino.', index: 4810},
    'help.PostingBalloonTip_description_99_379': {value: 'Svoje vozilo opi\u0161ite tako, da bo kupec hrepenel po njem in se mu bodo ob specifikacijah cedile sline. Uporabite ve\u010D fotografij z vsaj 150 besedami, in kupcu povejte, kako zelo ste ljubili svojo dragoceno lastnino.', index: 4811},
    'help.PostingBalloonTip_phone_99': {value: 'Prosimo, vnesite 10-mestno telefonsko \u0161tevilko, kamor vas zainteresirani kupci lahko pokli\u010Dejo.  STD koda je obvezna za nemobilne \u0161tevilke. Pred \u0161tevilko ne vnesite 0.', index: 4812},
    'help.PostingBalloonTip_photo_30': {value: 'Vstavite lahko do 20 fotografij. Preverite, ali so jasne in kvalitetne.  Ne dovoljujemo fotografij s spletnimi povezavami (URL) ali e-po\u0161tami.', index: 4813},
    'help.PostingBalloonTip_price_30_301': {value: 'Vnesite dejansko ceno za najem va\u0161e nepremi\u010Dnine. \u010Ce se je o ceni mogo\u010De pogajati, vnesite informacijo v opis v va\u0161em oglasu.', index: 4814},
    'help.PostingBalloonTip_price_30_363': {value: 'Vnesite dejansko ceno za najem va\u0161e nepremi\u010Dnine. \u010Ce se je o ceni mogo\u010De pogajati, vnesite informacijo v opis v va\u0161em oglasu.', index: 4815},
    'help.PostingBalloonTip_price_30_367': {value: 'Vnesite dejansko ceno in konkuren\u010Dno prodajo va\u0161e nepremi\u010Dnine.', index: 4816},
