    'help.PostingBalloonTip_price_30_415': {value: 'Vnesite dejansko in konkuren\u010Dno ceno za nakup ali najem va\u0161e nepremi\u010Dnine. \u010Ce se je o ceni mogo\u010De pogajati, vnesite informacijo v opis v va\u0161em oglasu.', index: 4824},
    'help.PostingBalloonTip_price_30_416': {value: 'Vnesite dejansko in konkuren\u010Dno ceno za prodajo va\u0161ega vozila.', index: 4825},
    'help.PostingBalloonTip_price_99_366': {value: 'Navedite ceno, ki je  realisti\u010Dna, in ki bo obenem povzro\u010Dila, da se bodo glave obra\u010Dale v smeri va\u0161ega predmeta. Nemogo\u010De nizka ali izredno visoka cena ne bosta privabili veliko zanimanja.', index: 4826},
    'help.PostingBalloonTip_price_99_367': {value: 'Investicija v nepremi\u010Dnine je draga zadeva, zato v okolici svoje lastnine dobro preu\u010Dite zadeve, da boste pri\u0161li do cene, ki bo v skladu s prevladajo\u010Dim trendom in hkrati konkuren\u010Dna.', index: 4827},
    'help.PostingBalloonTip_price_99_378': {value: 'Bodite previdni in navedite ceno, ki je v skladu s starostjo in stanjem va\u0161ega vozila.', index: 4828},
