    'help.PostingBalloonTip_title_30_301': {value: 'Naslov va\u0161ega oglasa naj povzame, kaj ogla\u0161ate. Npr. soba za dekleta v mestu  Sao  Paulo', index: 4830},
    'help.PostingBalloonTip_title_30_363': {value: 'Dajte svojemu oglasu privla\u010Den naslov! Vnesite vrsto nepremi\u010Dnine, sosesko, \u0161tevilo sob. Npr. hi\u0161a v kraju M\xF3oca, 3 spalnice, opremljena', index: 4831},
    'help.PostingBalloonTip_title_30_367': {value: 'Dajte svojemu oglasu privla\u010Den naslov! Vnesite vrsto nepremi\u010Dnine, sosesko, \u0161tevilo sob, npr. hi\u0161a v kraju M\xF3oca, 3 spalnice, opremljena', index: 4832},
    'help.PostingBalloonTip_title_30_368': {value: 'Dajte svojemu oglasu privla\u010Den naslov!  Vnesite sosesko, mesto, velikost. Npr. trgovina v kraju Br\xE1s, S\xE3o Paulo, 180 m\xB2.', index: 4833},
    'help.PostingBalloonTip_title_30_376': {value: 'Vnesite znamko, model in podrobnosti, npr. hitri motorni \u010Doln 18 \u010Devljev z evinrude 115 hp', index: 4834},
    'help.PostingBalloonTip_title_30_377': {value: 'Opi\u0161ite del, da pojasnite, za kaj je uporaben, npr. plati\u0161\u010De za kolo 14 za Fiat Palio', index: 4835},
    'help.PostingBalloonTip_title_30_378': {value: 'Dopolnite naslov z ve\u010D podrobnostmi, npr. 2012 Fiesta 1.6. v odli\u010Dnem stanju!', index: 4836},
