    'help.PostingBalloonTip_title_30_410': {value: 'Dajte svojemu oglasu privla\u010Den naslov! Vnesite sosesko, mesto, velikost. Npr. parcela v kraju Perdizes, S\xE3o Paulo, 200 m\xB2.', index: 4839},
    'help.PostingBalloonTip_title_30_415': {value: 'Dajte svojemu oglasu privla\u010Den naslov!  Vnesite sosesko, mesto, velikost. Npr. restavracija v Salvadorju, 180 m\xB2.', index: 4840},
    'help.PostingBalloonTip_title_30_416': {value: 'Vnesite znamko, model in podrobnosti, npr. dostavno vozilo Renault Master 2010, 16 sede\u017Eev, v odli\u010Dnem stanju!', index: 4841},
    'help.PostingBalloonTip_title_99_366': {value: 'Svojemu predmetu dajte navdu\u0161ujo\u010D naslov, da bo imel mo\u010D in mi\u0161ice za doseganje kupcev. Npr. fantasti\u010Den  W910i Sony Walkman telefon z 2GB pomnilni\u0161ko kartico.', index: 4842},
    'help.PostingBalloonTip_title_99_367': {value: 'To bo odlo\u010Dilo o uspehu ali polomu va\u0161e kup\u010Dije! Pozornost kupca ujemite s tem, da ste specifi\u010Dni. Uporabnik v va\u0161o ponudbo vlaga svoje \u017Eivljenjske prihranke.', index: 4843},
    'help.PostingBalloonTip_title_99_378': {value: 'Zum-zum....!!! Zanimiv naslov nemudoma zagrabi pozornost kupcev in jih povabi, da z vami takoj stopijo v stik. Npr. Honda City - \u010Drna lepotica s sve\u017Eimi, elegantnimi, senzacionalnimi, spo\u0161tovanje vzbujajo\u010Dimi oblinami in motorjem.', index: 4844},
    'help.PostingBalloonTip_title_99_379': {value: 'Zum-zum....!!! Zanimiv naslov nemudoma zagrabi pozornost kupcev in jih povabi, da z vami takoj stopijo v stik. Npr. Honda City - \u010Drna lepotica s sve\u017Eimi, elegantnimi, senzacionalnimi, spo\u0161tovanje vzbujajo\u010Dimi oblinami in motorjem.', index: 4845},
