    'terms.NotificationClaimsOfInfrigements_content_one': {value: 'If you are a copyright owner or an agent thereof and believe that any user Content or other content infringes upon your copyrights, you may submit a notification pursuant to the Digital Millennium Copyright Act ("DMCA") by providing our Copyright Agent with the following information in writing (see 17 U.S.C 512(c)(3) for further detail):', index: 4908},
    'terms.NotificationClaimsOfInfrigements_content_one_list': {value: '<ol><li> A physical or electronic signature of a person authorized to act on behalf of the owner of an exclusive right that is allegedly infringed;</li><li> Identification of the copyrighted work claimed to have been infringed, or, if multiple copyrighted works at a single online site are covered by a single notification, a representative list of such works at that site;</li><li> Identification of the material that is claimed to be infringing or to be the subject of infringing activity and that is to be removed or access to which is to be disabled and information reasonably sufficient to permit OLX to locate the material;</li><li> Information reasonably sufficient to permit OLX to contact you, such as an address, telephone number, and, if available, an electronic mail address; </li><li> A statement that you have a good faith belief that use of the material in the manner complained of is not authorized by the copyright owner, its agent, or the law; and</li><li> A statement that the information in the notification is accurate, and under penalty of perjury, that you are authorized to act on behalf of the owner of an exclusive right that is allegedly infringed.</li></ol>', index: 4909},
    'terms.NotificationClaimsOfInfrigements_content_two': {value: 'OLX\'s designated Copyright Agent to receive notifications of claimed infringement is:  Alejandro C. Oxenford, OLX, S.A., Uriarte 2489 - 3rd Floor, Buenos Aires, Argentina, telephone/fax:  (011) 54-11-4775-6696 or <<CONTACTLINK_LEGAL>>contact OLX regarding legal issues<</CONTACTLINK_LEGAL>>.  For clarity, only DMCA notices should go to the Copyright Agent; any other feedback, comments, requests for technical support, and other communications should be directed to OLX\'s customer service by clicking on the Contact Us link on the OLX website. You acknowledge that if you fail to comply with all of the requirements of this Section 4, your DMCA notice may not be valid.', index: 4910},
    'terms.NotificationClaimsOfInfrigements_title': {value: 'NOTIFICATION OF CLAIMS OF INFRINGEMENTS', index: 4911},
    'terms.PrivacyPolicyInformationDisclosure_content': {value: 'By using this website you acknowledge and agree that OLX may, in its sole discretion, preserve or disclose your Content, as well as your information, such as email addresses, IP addresses, timestamps, and other user information, if required to do so by law or in the good faith belief that such preservation or disclosure is reasonably necessary to: comply with legal process; enforce these Terms; respond to claims that any Content violates the rights of third-parties; respond to claims that contact information (for example phone number, street address) of a third-party has been posted or transmitted without their consent or as a form of harassment; protect the rights, property, or personal safety of OLX, its users or the general public.', index: 4912},
    'terms.PrivacyPolicyInformationDisclosure_title': {value: 'PRIVACY POLICY AND INFORMATION DISCLOSURE', index: 4913},
    'terms.PropietaryRights_content': {value: 'The Service is protected to the maximum extent permitted by copyright laws and international treaties.  Content displayed on or through the Service is protected by copyright as a collective work and/or compilation, pursuant to copyrights laws, and international conventions.  Any reproduction, modification, creation of derivative works from or redistribution of the website or the collective work is prohibited.  Copying or reproducing the website or any portion thereof to any other server or location for further reproduction or redistribution is prohibited.  You further agree not to reproduce, duplicate or copy Content from the Service, and agree to abide by any and all copyright notices displayed on the Service.  You may not decompile or disassemble, reverse engineer or otherwise attempt to discover any source code contained in the Service.  Without limiting the foregoing, you agree not to reproduce, duplicate, copy, sell, resell or exploit for any commercial purposes, any aspect of the Service.  OLX is a mark registered in the U.S. Patent and Trademark Office. <br />Although OLX does not claim ownership of content that its users post, by posting Content to any public area of the Service, you automatically grant, and you represent and warrant that you have the right to grant, to OLX an irrevocable, perpetual, non-exclusive, fully paid, worldwide license to use, copy, perform, display, and distribute said Content and to prepare derivative works of, or incorporate into other works, said Content, and to grant and authorize sublicenses (through multiple tiers) of the foregoing.  We need these rights in order to host and display your content', index: 4914},
