    'terms.TermsOfUse': {value: 'Pogoji uporabe', index: 4918},
    'terms.TermsOfUseWarning': {value: 'V vednost je OLX pripravil povezavo do prevoda angle\u0161ke verzije Pogojev na spodnji povezavi.  Kot je navedeno v Pogojih, vi razumete in se strinjate s tem, da je vsak prevod Pogojev v drug jezik samo za va\u0161o la\u017Ejo uporabo  ter da angle\u0161ka verzija ureja pogoje va\u0161ega razmerja z  OLX. Nadalje, \u010De obstajajo kak\u0161na protislovja med angle\u0161ko verzijo Pogojev in katerimkoli prevodom, vlada angle\u0161ka verzija Pogojev.', index: 4919},
