    'about.12345678': {value: '<B> Enter the actual price for your property. </B>', index: 4929},
    'about.About': {value: '<table class="resize" width="900" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0"> <tr><td height="30" colspan="2" bgcolor="#FFB18C" class="titOLX"><span class="titolx1">About OLX</td></tr></table><table class="resize" width="900" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0">  <tr valign="top">  <th align="left" class="MainBodyBkgrdBrdr" scope="col"> <table width="900" border="0" cellspacing="0" cellpadding="0" align="left">    <tr>     <th align="left" valign="top" class="MainBodyBkgrd"><table width="900" border="0" cellspacing="5" cellpadding="5" align="left">  <tr>    <td>     <table width="100%" border="0" cellspacing="0" cellpadding="0" align="left" class="cuadro">        <tr> <td><table width="100%" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0"> <tr><td align="left" class="aviso2"><br />OLX means free local classifieds on a global level. OLX allows you to meet others, express yourself, trade products, find jobs, apartments, and much more! <br/ ><br/ >We built OLX to improve on traditional classified sites, which are functional but missing key features to really deliver a proper public service to communities everywhere.<br /></td></tr> <tr><td align="left" class="aviso2">On OLX you can:<br /><br /><ul><li>Easily design rich HTML listings</li><li>Control your selling, buying, and community activity in My OLX</li><li>Send or accept PayPal payments</li><li>Be assured of a spam-free experience</li><li>Promote your listings on other websites, like MySpace, Xanga, and Blogspot</li><li>Discuss listings with other interested users</li><li>Enjoy a website that has world-class speed</li><li>Search for items near you, wherever you live</li><li>Access our site from your mobile phone</li><li>View our site in your local language</li></ul>OLX has a presence on six continents. The company was founded in March 2006 and is privately held.<br/ ><br/ ></b></td></tr></table></td>        </tr>      </table>    </td>  </tr></table><br /><br />     </th>    </tr>         </table>  </th><!-- END MAIN PAGE COLUMN --> </tr></table>', index: 4930},
    'about.AboutBrand': {value: 'O OLX', index: 4931},
    'about.AboutText1': {value: 'OLX je vodilna svetovna platforma za male oglase, ki se osredoto\u010Da na tr\u017Ei\u0161\u010Da v vzponu, tako mobilna, kot na spletu', index: 4932},
    'about.AboutText2': {value: 'OLX deluje globalno in je prisoten v ve\u010D kot 40 dr\u017Eavah', index: 4933},
    'about.about_Body': {value: '<p>OLX je naslednja generacija brezpla\u010Dnih spletnih malih oglasov.<br /><br />OLX nudi preprosto re\u0161itev pri zapletih, ki se pojavijo pri prodaji, nakupu, menjavi, razpravah, organizaciji in spoznavanju blizu \u017Eive\u010Dih ljudi, kjer koli ste nastanjeni.<br /><br />OLX vam omogo\u010Da:<br /><ul><li>enostavno oblikovanje bogatih oglasov s fotografijami;</li><li>nadzorovanje va\u0161e aktivnosti pri prodaji, nakupu in skupnosti v razdelku Moj OLX\xAB;</li><li>prikaz va\u0161ih objav v va\u0161em profilu dru\u017Eabnih stikov (Facebook, Myspace ...);</li><li>dostop do spletne strani preko va\u0161ega mobilnega telefona;</li><li>ogled  OLX v va\u0161em jeziku.</li></ul><br />OLX uporabljajo v ve\u010D kot <<QTY_COUNTRIES>> dr\u017Eavah, v <<QTY_LANGUAGES>> jezikih. Podjetje je bilo ustanovljeno marca 2006 in je zasebno.</p>', index: 4934},
