    'about.BrandHasOfficesInNYAndBA': {value: 'OLX has offices in New York, USA (485 7th Avenue, suit 507, New York, 10018) and in Buenos Aires, Argentina (Uriarte 2489, 1er Piso, 1425).', index: 4938},
    'about.BuyersForAllYouSell': {value: 'Na OLX so kupci za skoraj vse, kar \u017Eelite prodati.</br>Milijoni ljudi so \u017Ee prodali svoje stvari na OLX. Tudi vi lahko to storite.', index: 4939},
