    'about.FastAndEasy': {value: 'OLX je hiter in enostaven na\u010Din za prodajo va\u0161ih stvari. <strong>Je brezpla\u010Den</strong>.', index: 4952},
    'about.GeneralCounsel': {value: 'General Counsel', index: 4953},
    'about.History': {value: 'Zgodovina', index: 4954},
    'about.HistoryText1': {value: 'OLX sta leta 2006 v Argentini soustanovila internetna podjetnika Fabrice Grinda in Alec Oxenford. Danes je ena od vodilnih svetovnih platform za brezpla\u010Dne male oglase, na voljo v ve\u010D kot 40 dr\u017Eavah in 50 jezikih.', index: 4955},
    'about.HistoryText2': {value: 'Vsak dan milijoni ljudi po vsem svetu uporabljajo  OLX za nakup in prodajo blaga in avtomobilov, da bi na\u0161li slu\u017Ebo ali najeli hi\u0161o. Platforma OLX ima preko 200 milijonov  edinstvenih mese\u010Dnih uporabnikov, ki ustvarjajo promet v vi\u0161ini preko 11 milijard ogledov strani mese\u010Dno ali okoli 360 milijonov ogledov strani dnevno. Skupina ima 1200 zaposlenih, ki delajo v Buenos Airesu, Cape Townu, Delhiju, Sao Paulu, Rio de Janeiru, Lizboni in New Yorku.', index: 4956},
    'about.HistoryText3': {value: 'V za\u010Detku je v avgustu 2010 Naspers pridobil 67,8 % udele\u017Ebo v OLX.inc, ki jo je kasneje zve\u010Dal na 95 %. Kot del inciative za preoblikovanje OLX v najve\u010Djo svetovno znamko za trgovanje potro\u0161nika s potro\u0161nikom  (C2C) je Naspers nedavno zdru\u017Eil svoje spletne storitve malih oglasov na Filipinih, na Tajski, na Poljskem, na Mad\u017Earskem, v Bolgariji, v Romuniji in v Indoneziji, ter jih je preimenoval v  OLX.', index: 4957},
