    'about.PostingBalloonTip_description_30_301': {value: 'Vnesite podrobnosti o va\u0161i nepremi\u010Dnini, kot npr. klimatizacija, omare, spredaj ali zadaj, dru\u017Eina, penzion.', index: 4979},
    'about.PostingBalloonTip_Email_0_0': {value: 'Vnesite svoje resni\u010Dno ime, da bodo kupci vedeli, kako vas klicati, ko stopijo v stik z vami. Ni vam potrebno vnesti celotnega imena.', index: 4980},
