    'about.SellThings': {value: 'Prodajte svoj rabljeni telefon, ki le\u017Ei v predalu.</br>Prodajte kitaro, katere nikoli ne igrate.</br>Prodajte otro\u0161ki vozi\u010Dek soje sestre, ki se skriva v njeni omari.</br>Prodajte svoj motor in si kupite novej\u0161ega.</br>Prodajte tiste \u010Devlje, ki vam niso \u010Disto prav.</br>Prodajte svoj avto.</br>', index: 4983},
