    'about.WeekendTakesLonger': {value: 'Ads posted during the night or weekend might take longer to appear active. Do not duplicate your ad.', index: 4989},
    'about.WithinTime': {value: '<li>V nekaj sekundah lahko objavite predmet za prodajo (uporabite svoj telefon!)</li><li>V nekaj minutah se bo va\u0161 predmet pojavil na OLX</li><li>V nekaj urah se vam bodo oglasili zainteresirani kupci</li><li>V nekaj dneh se boste sre\u010Dali s kupci in svoje stvari zamenjali za goovino</li><li>V nekaj tednih si boste poenostavili in izbolj\u0161ali \u017Eivljenje</li>', index: 4990},
    'mail_crm.AntiFraudInfo': {value: '<p style="padding: 0pt 5px;">Za ve\u010D informacij obi\u0161\u010Dite na\u0161 <a href="<<ForumLink>>">forum za za\u0161\u010Dito pred goljufijami</a>, za ve\u010D koristnih nasvetov glede varnosti pa <a href="<<Help26Link>>">kliknite tu</a>.</p>', index: 4991},
    'mail_crm.CongratulationsForPostingYourFirstAdOnBrand': {value: '\u010Cestitamo za objavo va\u0161ega prvega oglasa na  OLX!', index: 4992},
    'mail_crm.ContactUsLink': {value: '<<CONTACTLINK>>Stopite v stik z nami<</CONTACTLINK>>', index: 4993},
    'mail_crm.CRM1_Bullet_1': {value: '<<LI_MARGIN_5PX>><strong>NIKOLI ne prodajajte ni\u010Desar nikomur izven dr\u017Eave, v kateri prebivate. </strong><br /> Odobritev pla\u010Dila, ki ga naro\u010Di tuja banka, lahko pri va\u0161i banki traja kar 3 do 4 tedne ali ve\u010D. V tem \u010Dasu bo nakazani znesek sicer na va\u0161em ban\u010Dnem ra\u010Dunu, a \u010De se izka\u017Ee, da je z nakazilom karkoli narobe, vam bodo ta znesek od\u0161teli z va\u0161ega ra\u010Duna. <</LI_MARGIN_5PX>>', index: 4994},
    'mail_crm.CRM1_Bullet_2': {value: '<<LI_MARGIN_5PX>><strong>Nikoli ne sprejmite gotovinskega \u010Deka iz tujine. </strong><br /> Ve\u010Dina prevarantov po\u0161ilja ponarejene gotovinske \u010Deke. <</LI_MARGIN_5PX>>', index: 4995},
    'mail_crm.CRM1_Bullet_3': {value: '<<LI_MARGIN_5PX>><strong>NIKOLI ne sprejmite pla\u010Dila, ki presega ceno va\u0161ega predmeta. </strong><br />NIKOLI ne po\u0161iljajte denarja, da bi vrnili prepla\u010Dani znesek, ne glede na razlog, ki vam je bil dan (darilo, stro\u0161ki po\u0161iljanja, carina, honorarji posrednikov...)<</LI_MARGIN_5PX>>', index: 4996},
    'mail_crm.CRM1_Bullet_4': {value: '<<LI_MARGIN_5PX>><strong>\u010Ce se kupec predstavlja kot posrednik (pravnik, svetovalec...), ki zastopa svojega tujega klienta, NE POSLUJTE Z NJIM.</strong><</LI_MARGIN_5PX>>', index: 4997},
    'mail_crm.CRM1_Bullet_5': {value: '<<LI_MARGIN_5PX>><strong>OLX nikoli ne sodeluje v pogajanjih in transakcijah.</strong><br /> Ne posredujemo pri pla\u010Dilih in po\u0161iljanju, ne ponujamo garancije na zadovoljstvo s kupljenim in ne ponujamo financiranja ali finan\u010Dne za\u0161\u010Dite kupcem ali prodajalcem.<</LI_MARGIN_5PX>>', index: 4998},
    'mail_crm.CRM1_Bullet_6': {value: '<<LI_MARGIN_5PX>><strong>Nikoli ne objavite svojih finan\u010Dnih informacij,</strong><br /> kot so npr. \u0161tevilka ban\u010Dnega ra\u010Duna, \u0161tevilka socialne varnosti ipd. \u2026 <</LI_MARGIN_5PX>>', index: 4999},
    'mail_crm.CRM1_Bullet_7': {value: '<<LI_MARGIN_5PX>><strong>Bodite izredno previdni, \u010De morate  predmet poslati po po\u0161ti, ali pa uporabite usluge poro\u0161tvene slu\u017Ebe.</strong>><</LI_MARGIN_5PX>>', index: 5000},
    'mail_crm.CRM1_Bullet_8': {value: '<<LI_MARGIN_5PX>><strong>\u010Ce ste prejeli e-po\u0161tno sporo\u010Dilo o tem, da ste zadeli nagrado, ter da naj bi pla\u010Dali za njeno dostavo, ne odgovorite na sporo\u010Dilo in stopite v stik z na\u0161o</strong><<CONTACTLINK>>Skupino za storitve za stranke<</CONTACTLINK>><</LI_MARGIN_5PX>>', index: 5001},
    'mail_crm.CRM_FirstPost_02_Body': {value: '<p><strong>\u010Cestitamo! Pravkar ste oddali svoj prvi oglas na OLX: <<ItemTitle>></strong></p><p>Priporo\u010Damo, da si to sporo\u010Dilo shranite, saj vam navedene informacije lahko pridejo prav pri bodo\u010Dih transakcijah v zvezi z malimi oglasi in spletnimi dra\u017Ebami.</p><p>Svetujemo vam, da vedno poslujete lokalno, saj se tako lahko oba udele\u017Eenca osebno sre\u010Data pred nadaljevanjem transakcije.</p><p>Za primere, ko morebitni kupec/prodajalec ni iz va\u0161ega obmo\u010Dja, vam priporo\u010Damo naslednje:</p><ol style="border-top:1px solid #DCDCDC;border-bottom:1px solid #DCDCDC;background-color:#E9E9E9; padding-right:5px;"><li style="margin: 5px 0"><span style="color: #ff6e33;">NIKOLI ne prodajajte ni\u010Desar nekomu izven dr\u017Eave, v kateri prebivate. </span><br />Odobritev pla\u010Dila, ki ga naro\u010Di tuja banka, lahko pri va\u0161i banki traja kar 3 do 4 tedne ali ve\u010D. V tem \u010Dasu bo nakazani znesek sicer na va\u0161em ban\u010Dnem ra\u010Dunu, a \u010De se izka\u017Ee, da je z nakazilom karkoli narobe, vam bodo ta znesek od\u0161teli z va\u0161ega ra\u010Duna. </li><li style="margin: 5px 0"><span style="color: #ff6e33;">NIKOLI ne sprejmite pla\u010Dila, ki presega ceno va\u0161ega predmeta. </span><br />NIKOLI ne po\u0161iljajte denarja, da bi vrnili prepla\u010Dani znesek, ne glede na razlog (darilo, stro\u0161ki po\u0161iljanja, carina, honorarji posrednikov ...)</li><li style="margin: 5px 0"><span style="color: #ff6e33;">\u010Ce se kupec predstavlja kot posrednik (pravnik, svetovalec itd.), ki zastopa svojega tujega klienta, NE POSLUJTE Z NJIM.</span></li><li style="margin: 5px 0"><span style="color: #ff6e33;">OLX nikoli ne sodeluje v pogajanjih in transakcijah.</span><br />Ne posredujemo pri pla\u010Dilih in po\u0161iljanju, ne ponujamo garancije na zadovoljstvo s kupljenim in ne ponujamo financiranja ali finan\u010Dne za\u0161\u010Dite kupcem ali prodajalcem.</li></ol><<AntiFraudForum>> <<AntiFraudHelp>><<ANONYMOUSUSER>><p>\u017Delimo vam \u010Dimbolj uspe\u0161no poslovanje na OLX!<br /><<FooterMail_01_Support>><br /></p><<REGISTEREDUSER>>', index: 5002},
    'mail_crm.CRM_FirstPost_031_AnonymousUser': {value: '<p style="color:#f00;"><strong>KORISTEN NAMIG:</strong></p><p>\u010Ce \u017Eelite uporabljati OLX, se vam ni treba registrirati, vendar vam to vseeno priporo\u010Damo: <br /><ul><li>La\u017Ee boste urejali svoje objave;</li><li>Registracija je hitra in brezpla\u010Dna.</li></ul><a href="<<RegisterLink>>">Registrirajte se zdaj!</a></p>', index: 5003},
    'mail_crm.CRM_FirstPost_031_RegisteredUser': {value: '\u010Ce ne \u017Eelite prejemati nasvetov podjetja OLX, preprosto <<ModifEmailNotificationLink>>kliknite tu<</ModifEmailNotificationLink>> in po\u010Distite polje za izbiro: \xBB\u017Delim prejemati nasvete v zvezi s kupovanjem in prodajo na spletni strani OLX\xAB.', index: 5004},
