    'misc.Content_text1': {value: 'Vir mora vsebovati vsakega od oglasov, ki ga \u017Eelite imeti v \u017Eivo na OLX.  Oglasi, ki so v viru, bodo objavljeni na OLX.  Kateri koli oglasi, ki niso ve\u010D v viru, bodo odstranjeni z OLX. Za to mo\u017Enost zahtevamo stati\u010Den URL (URL, ki se nikoli ne spremeni).', index: 10005},
    'misc.Content_text2': {value: 'Vsak vir bo vseboval nove oglase, ki jih \u017Eelite objaviti, oglase, ki jih \u017Eelite urediti, ter oglase, ki jih \u017Eelite odstraniti. Oglasov, ki jih ne \u017Eelite spreminjati, ni potrebno vklju\u010Diti. Zahtevamo  URL, ki se spreminja vsak dan, na osnovi datuma. Obi\u010Dajno sprejemamo delta vire samo od partnerjev, ki imajo preko 100.000 oglasov. \u010Ce jih imate manj kot 100.000, vendar bi nam \u017Eeleli preskrbeti delta vir, vas prosimo, da najprej stopite v stik z nami, da vidite, \u010De ta mo\u017Enost obstaja.', index: 10006},
