    'misc.DidYouKnow_2_BR': {value: 'Ali ste vedeli? Skrajni rok za to, da je va\u0161 oglas predstavljen, je 48 ur. Ko je enkrat predstavljen, bo predstavljen izmeni\u010Dno z drugimi objavljenimi  oglasi. \u010Ce je skrajni rok potekel, va\u0161 oglas pa \u0161e ni bil predstavljen, stopite v stik z nami. Prilo\u017Eite potrdilo o pla\u010Dilu, da bomo lahko pregledali va\u0161o situacijo.', index: 10042},
