    'misc.PostingBalloonTip_Address_0_0': {value: '\u010Ce vnesete svoj naslov, bo va\u0161 oglas prikazan na zemljevidu v na\u0161i  OLX mobilni aplikaciji. \u010Ce ne \u017Eelite vnesti svojega natan\u010Dnega naslova, lahko vnesete najbli\u017Eji vogal ali naslov drugega primernega mesta za sre\u010Danje.', index: 10432},
    'misc.PostingBalloonTip_ContactName_0_0': {value: 'Vnesite svoje resni\u010Dno ime, da bodo kupci vedeli, kako vas klicati, ko stopijo v stik z vami. Ni vam potrebno vnesti celotnega imena.', index: 10433},
    'misc.PostingBalloonTip_Description_0_0': {value: 'Podrobnosti so pomembne. Vnesite vse va\u017Ene informacije, kot so velikost, barva, ali ima dodatke, v kak\u0161nem stanju je ipd.', index: 10434},
    'misc.PostingBalloonTip_description_0_301': {value: 'Vnesite podrobnosti o va\u0161i posesti, kot je klimatizacija, omarice, spredaj ali zadaj, dru\u017Eina, penzion..', index: 10435},
    'misc.PostingBalloonTip_description_0_363': {value: 'Vnesite podrobnosti o va\u0161i posesti, kot so parkirna mesta, bazen, \u0161tevilo kopalnic, \u017Ear, balkon, blizu trgovin, \u0161ol, pekarn, lekarn.', index: 10436},
    'misc.PostingBalloonTip_description_0_367': {value: 'Vnesite podrobnosti o va\u0161i posesti, kot so parkirna mesta, bazen, \u0161tevilo kopalnic, \u017Ear, balkon, blizu trgovin, \u0161ol, pekarn, lekarn.', index: 10437},
    'misc.PostingBalloonTip_description_0_368': {value: 'Vnesite podrobnosti, kot so lokacija, coniranje, topografija, znamenitosti, bli\u017Eina.', index: 10438},
    'misc.PostingBalloonTip_description_0_376': {value: 'Vnesite informacije, kot so zmo\u017Enost, motor, dokumentacija, gorivo.', index: 10439},
    'misc.PostingBalloonTip_description_0_377': {value: 'Vnesite informacije, kot je stanje ohranitve, tehni\u010Dne specifikacije in izvor.', index: 10440},
    'misc.PostingBalloonTip_description_0_378': {value: 'Vnesite podrobnosti, kot so okna na elektronski pomik, alarm, stereo, DVD predvajalnik, zra\u010Dna blazina, gorivo, popravila, klimatizacija.', index: 10441},
    'misc.PostingBalloonTip_description_0_379': {value: 'Vnesite informacije, kot je vrsta goriva, ali prodajate tudi \u010Delado ipd.', index: 10442},
    'misc.PostingBalloonTip_description_0_388': {value: 'Vnesite podrobnosti o va\u0161i posesti, kot je dol\u017Eina bivanja, \u0161tevilo kopalnic, \u017Ear, balkon, parkirna mesta, lokacija (sklicna to\u010Dka).', index: 10443},
    'misc.PostingBalloonTip_description_0_410': {value: 'Vnesite podrobnosti, kot so lokacija, coniranje, topografija, znamenitosti, bli\u017Eina.', index: 10444},
    'misc.PostingBalloonTip_description_0_415': {value: 'Vnesite podrobnosti, kot so lokacija, coniranje, topografija, znamenitosti, bli\u017Eina.', index: 10445},
    'misc.PostingBalloonTip_description_0_416': {value: 'Vnesite podrobnosti, kot so okna na elektronski pomik, alarm, stereo, DVD predvajalnik, zra\u010Dna blazina, gorivo, popravila, klimatizacija.', index: 10446},
    'misc.PostingBalloonTip_Description_0_802': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Write all the features, brand, model, accessories, if it has a defect or it includes games. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it. </LI><LI> If you still have guarantee mention it!</LI></UL>', index: 10447},
    'misc.PostingBalloonTip_Description_0_803': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Write all the features, brand, model, accessories, if it has any defect and if it has any installed software. </LI><LI> Say how you prefer to be contacted and how you want to make the sale. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI></UL>', index: 10448},
    'misc.PostingBalloonTip_Description_0_804': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Write all the features, brand, model, accessories, if it has a defect or includes memory cards. </LI><LI> Say how you prefer to be contacted and how you want to make the sale. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI></UL>', index: 10449},
    'misc.PostingBalloonTip_Description_0_805': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Write all the features, brand, model, if it has a defect or includes any accessory. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI><LI> Tell how you prefer to be contacted and how you want to make the sale. </LI></UL>', index: 10450},
    'misc.PostingBalloonTip_Description_0_807': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Write about the color, the size and the material it is made off. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI><LI> Tell how you prefer to be contacted and how you want to make the sale. </LI></UL>', index: 10451},
    'misc.PostingBalloonTip_Description_0_808': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Write down the brand, model, color, dimension and if it has a defect or includes any accessory. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI><LI> Tell how you prefer to be contacted and how you want to make the sale. </LI></UL>', index: 10452},
    'misc.PostingBalloonTip_Description_0_812': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Write down the breed, age, color and if it is male or female. </LI><LI> Also describe any characteristic in the body or behaviour, the vaccines recieved and documentation.</LI></UL>', index: 10453},
    'misc.PostingBalloonTip_Description_0_814': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Write all the features, brand, size and tell what is included. </LI><LI> Say how you prefer to be contacted and how you want to make the sale. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI></UL>', index: 10454},
    'misc.PostingBalloonTip_Description_0_816': {value: '<B> Include details in the description to sell fast! </B><UL><LI> Say how you prefer to be contacted and how you want to make the sale. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI></UL>', index: 10455},
    'misc.PostingBalloonTip_Description_0_818': {value: '<B>Include details in the description to sell fast! </B><UL><LI> Enter the brand, model, size, weight and tell what is included. </LI><LI> Say how you prefer to be contacted and how you want to make the sale. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI></UL>', index: 10456},
    'misc.PostingBalloonTip_Description_0_822': {value: '<B>Include details in the description to get good candidates! </B><UL><LI> Describe details about the position, requirements and responsibilities</LI><LI> Do not forget to talk about the location and benefits</LI></UL>', index: 10457},
    'misc.PostingBalloonTip_Description_0_823': {value: '<B>Include details in the description to catch the employers attention! </B><UL><LI> Describe in detail your professional experiences. </LI><LI> Do not forget to talk about their courses, qualifications and so on.</LI></UL>', index: 10458},
    'misc.PostingBalloonTip_Description_0_824': {value: '<B>Include details in the description to catch the customer\'s attention! </B><UL><LI> Describe in detail the types of services provided and what is included. </LI><LI> Enter a base value and payment terms. </LI><LI> Remember that advertising is key for the business!</LI></UL>', index: 10459},
    'misc.PostingBalloonTip_Description_0_831': {value: '<B>Include details in the description to sell fast! </B><UL><LI> Write all the features, brand, size, if it includes accesories or has any defect.</LI><LI> Say how you prefer to be contacted and how you want to make the sale. </LI><LI> Do not forget details like time of use, conservation status and why you are selling it.</LI></UL>', index: 10460},
