    'misc.PostingBalloonTip_Title_0_377': {value: '<B> Give an attractive title for your ad. </B><UL><LI> Include, make, model, condition, material and color. </LI><LI> If the accessory works only with certain make or model, tell which one.</LI><LI> Use keywords: think of the words that people use to search and find your ad.</LI></UL>', index: 10482},
