    'misc.ProhibitedItems': {value: '<li>Posvojitve otrok in dojen\u010Dkov</li><li>Pornografski material</li><li>Alkohol</li><li>\u017Divali za boje/tekme</li><li>Kri, telesni izlo\u010Dki in telesni deli</li><li>Vlomilska orodja</li><li>Ponarejeni izdelki</li><li>Zbirke podatkov</li><li>Oprema za elektronski nadzor</li><li>Stvari, ki so pod embargom</li><li>Ogo\u017Eene vrste</li><li>Vstopnice za dogodke</li><li>Petarde</li><li>Rakete, eksplozivi in eksplozivne snovi</li><li>Vladne identifikacije in licence</li><li>Nevarne kemikalije</li><li>Nevarni, omejeni in pokvarljivi predmeti</li><li>Srednje\u0161olske diplome, univerzitetna potrdila ipd.</li><li>Bolni\u0161ni\u010Dna oprema in splo\u0161na anestezija</li><li>Deli trupel in posmrtni ostanki</li><li>Nelegalne droge</li><li>Predmeti, ki kr\u0161ijo zakone o za\u0161\u010Diti stvari, ki so zgodovinsko, umetnostno in kulturno pomembne</li><li>Izdelki iz slonovine</li><li>Loterijske sre\u010Dke, kartice nagradnih iger</li><li>\u017Daljiv material - primeri vklju\u010Dujejo material, ki je etni\u010Dno ali rasno \u017Ealjiv</li><li>Farmacevtski proizvodi (na recept ali brez njega)</li><li>Fotografije umetnikov, pevcev, estradnikov niso dovoljene brez dovoljenja</li><li>Predmeti, povezani s policijo, vojsko, mornarico in letalstvom</li><li>Politi\u010Dne stvari</li><li>Proizvodi brez dovoljenja in registracije vladnih oblasti, kot so stisnjen zemeljski plin, poprov sprej, teko\u010Di naftni plin, cilindri</li><li>Programska oprema za odklepanje relefonov in video iger</li><li>Delnice in drugi vrednostni papirji</li><li>Oprema za nadzor</li><li>Toba\u010Dni izdelki</li><li>Nerealisti\u010Dne cene in druge ponudbe</li><li>Uporabljena kozmetika</li><li>Uporabljeno spodnje perilo</li><li>Oro\u017Eje in no\u017Ei</li><li>Proizvodi iz divjadi - naga\u010Deni primerki, in slonova kost</li><li>Velikoprodaja izdelkov z znamko (elektronika, mobilci)</li>', index: 10518},
    'misc.ProhibitedItemsByLaw_List': {value: '<li>Ponarejeni predmeti</li><li>Obrazi, imena in podpisi in avtografirani predmeti</li><li>Piratska programska oprema in filmi</li><li>Vodni \u017Eigi/logotipi/URL drugih spletnih mest</li><li>Nove luksuzne znamke</li>', index: 10519},
    'misc.ProhibitedItemsTitle': {value: 'Prepovedani in omejeni predmeti:', index: 10520},
    'misc.ProhibitedPractices': {value: '<li><strong>Objavljanje podvojenih oglasov</strong> - Vsak oglas, ki je objavljen ve\u010D kot enkrat, z isto vsebino ali naslovom v istem kraju in kategoriji, se smatra za podvojenega. Svetujemo vam, da ve\u010D oglasov objavite samo, \u010De imate naprodaj razli\u010Dne predmete ali storitve. Vsi podvojeni oglasi bodo izbrisani, in tisti, ki jih objavljajo, kaznovani, \u010De se bo problem ponavljal.</li><li><strong>Objavljanje materiala samo za odrasle/seksualno orientiranega materiala:</strong> Oglasi, ki se nana\u0161ajo na predmete, ki vklju\u010Dujejo predmete za uporabo pri spolni aktivnosti, niso dovoljeni. Vedite tudi, da naslovi, ki vsebujejo ekspliciten jezik samo za zrelo ob\u010Dinstvo, niso primerni, ne glede na dejanski predmet, ki je vsebovan v oglasu.</li><li>Pisanje <strong>zavajajo\u010Dih naslovov</strong></li><li>Nalaganje <strong>neprimerne/napa\u010Dne slike</strong> z oglasom</li><li>Objavljanje predmetov v <strong>neprimernih kategorijah</strong></li><li>Napa\u010Dno predstavljanje <strong>lokacije predmeta</strong></li><li>Navajanje <strong>nerealisti\u010Dne cene</strong></li>', index: 10521},
    'misc.ProhibitedPracticesTitle': {value: 'Prepovedane dejavnosti:', index: 10522},
