    'misc.TipsForBuyersList': {value: '<li>Kupujte lokalno, da boste lahko pregledali predmet, se sre\u010Dali s prodajalcem, ter pla\u010Dali ob \u010Dasu, ko predmet dvignete ali vam ga dostavijo. Ne pozabite, da se morate sre\u010Dati na varnem mestu. </li> <li>Najbolj\u0161i na\u010Din transakcije je, da predmet in pla\u010Dilo izmenjate isto\u010Dasno. </li> <li>Vpra\u0161ajte po jasnih informacijah o stanju predmeta, ceni, pla\u010Dilu in na\u010Dinu dostave.</li><li>Uporabljajte samo tiste pla\u010Dilne metode, ki jim zaupate in ki jih dobro poznate.</li> <li>Prodajalca vpra\u0161ajte za sledilno \u0161tevilko, \u010De bo predmet dostavljen po po\u0161ti. </li> <li>Od prodajalca dobite telefonsko \u0161tevilko, ki jo je mogo\u010De preveriti.</li> <li>V primeru elektronike, avtomobilov in motorjev preverite njihovo delovanje pred nakupom.</li> <li>Pou\u010Dite se o primerljivih cenah za predmet.</li> <li>Ne delite svojih finan\u010Dnih informacij. </li> <li>Vedno uporabljate funkcijo "Po\u0161lji e-po\u0161to prodajalcu" za to, da stopite v stik s prodajalcem. To nam bo pomagalo, da vas bomo lahko takoj obvestili, \u010De bomo izvedeli za goljufiva dejanja prodajalca.</li>', index: 10774},
    'misc.TipsForSellers': {value: 'Nasveti za prodajalce:', index: 10775},
    'misc.TipsForSellersList': {value: '<li>Za\u017Eeleno je, da ob dostavi prejmete celotno kupnino. Ne pozabite, da se morate sre\u010Dati na varnem mestu.</li><li>\u010Ce gre za obse\u017Eno naro\u010Dilo, preverite reference kupca.</li><li>Od kupca dobite telefonsko \u0161tevilko, ki jo je mogo\u010De preveriti.</li><li>Zagotovite, da ima va\u0161 predmet vse funkcije, ki ste jih navedli v objavljenem oglasu, da ne bo pri\u0161lo do nesporazumov s kupcem.</li><li>Ne delite svojih finan\u010Dnih informacij, razen tistih, ki so potrebne za pla\u010Dilo.</li>', index: 10776},
