    'payment.OLX_Free_Classifieds_Site': {value: 'OLX is a free Classifieds site.Looking for a car, apartment, jobs, DVD... You can find anything you are looking for in your city.Need to sell your old CD or piece of furniture?Sell, exchange and buy anything on OLX.No commission fees!', index: 11414},
    'payment.Payment_Error': {value: 'Payment Error', index: 11415},
