    'payment.Unlimited_Access_To_All_OLX': {value: 'Unlimited access to all OLX for 30 minutes (Searching, browsing, contacting, posting...)', index: 11418},
    'payment.We_Could_Not_Charge_You_Properly': {value: 'We could not charge you properly. Please contact Globe customer service.', index: 11419},
    'payment.You_Can_Now_Use_Unlimited_OLX': {value: 'You can now use unlimited OLX service for 30 minutes.', index: 11420},
    'mail_crm2.BeCautiousAboutSellersWithVeryPoorLanguageSkills': {value: '<li><strong>Bodite previdni</strong> pri prodajalcih, ki zelo slabo obvladajo jezik, v katerem poteka komunikacija. V splo\u0161nem velja, da naj se ne bi odzivali na oglase, ki niso napisani v va\u0161em jeziku.</li>', index: 11421},
    'mail_crm2.BrandNeverTakesPartInTransactions': {value: '<li><strong>OLX NIKOLI ne sodeluje pri transakcijah, tudi \u010De prodajalec trdi nasprotno</strong>. \u010Ce vas kdo sku\u0161a prepri\u010Dati v kaj takega, prekinite komunikacijo z njim.<ol><li>Nikoli ne sodelujemo pri pogajanjih, transakciji ali dostavi.</li><li>Ne ponujamo financiranja, za\u0161\u010Dite kupcev ali certifikatov za prodajalce.</li><li>\u010Ce prejmete kakr\u0161nokoli sporo\u010Dilo, ki naj bi prihajalo od podjetja OLX, v njem pa so zagotovila glede transakcije ali dostave, ZAVRNITE transakcijo.</li></ol></li>', index: 11422},
    'mail_crm2.crm_ContactSeller_Body1': {value: 'Pravkar ste prvi\u010D odgovorili na oglas, objavljen na spletni strani OLX, zato bi vam radi v tem trenutku ponudili nekaj nasvetov v zvezi z varnostjo.<br /><br />Toplo vam priporo\u010Damo, da prodajalca osebno sre\u010Date, saj se boste tako la\u017Eje prepri\u010Dali o njegovi zanesljivosti in kakovosti ponujenega predmeta. To je dale\u010D najvarnej\u0161i in naju\u010Dinkovitej\u0161i na\u010Din poslovanja.<br /><br />\u010Ce pa tak na\u010Din poslovanja ni mogo\u010D, vam svetujemo naslednje:<br /><br />', index: 11423},
    'mail_crm2.crm_ContactSeller_Body2': {value: '<li><strong>BREZPLA\u010CNA DARILA</strong> kot na primer avtodomi, avtomobili, motorji, \u0161tirikolesniki, dragocene \u017Eivali itd.  <strong>NE OBSTAJAJO</strong>.<br />To so goljufije, \u0161e posebej, \u010De so (la\u017Ene) dobrine v drugi dr\u017Eavi in vi \xBBPLA\u010CATE LE\xAB stro\u0161ke po\u0161iljanja.</li><br /><li><strong>NE KUPITE</strong> vozila, \u010De prodajalec trdi, da vozilo ni / ni ve\u010D v va\u0161i dr\u017Eavi (iz kateregakoli razloga).</li><br /><li>Televizorji z ravnimi zasloni, kamere in novi ra\u010Dunalniki, ki so <strong>naprodaj s 50 - 75 % popusta iz tujine, v resnici ne obstajajo.</strong>.</li><br /><li><strong>Bodite previdni</strong> pri prodajalcih, ki zelo slabo obvladajo jezik, v katerem poteka komunikacija. V splo\u0161nem velja, da naj se ne bi odzivali na oglase, ki niso napisani v va\u0161em jeziku.</li><br /><li><strong>Ne kupujte \u017Eivali iz tujih dr\u017Eav.</strong> Spo\u0161tujte veljavne zakone. Zavedajte se, da je trgovanje z dolo\u010Denimi \xBBeksoti\u010Dnimi\xAB \u017Eivalmi strogo prepovedano.</li><br /><li><strong>OLX NIKOLI ne sodeluje pri transakcijah, tudi \u010De prodajalec trdi nasprotno</strong>. \u010Ce vas kdo sku\u0161a prepri\u010Dati v kaj takega, prekinite komunikacijo z njim.<ol><li>Nikoli ne sodelujemo pri pogajanjih, transakciji ali dostavi.</li><li>Ne ponujamo financiranja, za\u0161\u010Dite kupcev ali certifikatov za prodajalce.</li><li>\u010Ce prejmete kakr\u0161nokoli sporo\u010Dilo, ki naj bi prihajalo od podjetja OLX, v njem pa so zagotovila glede transakcije ali dostave, ZAVRNITE transakcijo.</li></ol></li>', index: 11424},
    'mail_crm2.crm_ContactSeller_Body3': {value: '<br /><<AntiFraudForum>> <<AntiFraudHelp>><br />\u017Delimo vam \u010Dim uspe\u0161nej\u0161e poslovanje.<br /><br />', index: 11425},
    'mail_crm2.crm_ContactSeller_Subject': {value: 'Va\u0161 odgovor na oglas: <<ItemTitle>>', index: 11426},
    'mail_crm2.DearUser': {value: 'Spo\u0161tovani uporabnik!', index: 11427},
    'mail_crm2.DoNotPurchaseAnimalsFromOutsideYourCountry': {value: '<li><strong>Ne kupujte \u017Eivali iz tujih dr\u017Eav.</strong> Spo\u0161tujte veljavne zakone. Zavedajte se, da je trgovanje z dolo\u010Denimi \xBBeksoti\u010Dnimi\xAB \u017Eivalmi strogo prepovedano.</li>', index: 11428},
    'mail_crm2.HoweverIfThisIsNotPossibleHereIsSomeAdvice': {value: '\u010Ce pa to ni mogo\u010De, je tu nekaj nasvetov:', index: 11429},
    'mail_crm2.NeverPayTheSellerForDeliveringAnAnimalToYou': {value: '<li><strong>NIKOLI</strong> prodajalcu ne pla\u010Dajte za dostavo \u017Eivali do vas. Ta \u017Eival najverjetneje ne obstaja. To je la\u017Ena pretveza, da bi od vas izvabili denar.</li>', index: 11430},
    'mail_crm2.NeverPayThroughWesternUnionEspeciallySomeoneWhoIsAbroad': {value: '<li><strong>NIKOLI ne pla\u010Dajte preko Western Union</strong>, \u0161e posebno pa ne nekomu, ki je v tujini.</li>', index: 11431},
    'mail_crm2.ThereAreNoGiftsOfValuableAnimals': {value: '<li><strong>DRAGOCENE \u017DIVALI KOT DARILA NE OBSTAJAJO.</strong> Najverjetneje je, da ste se soo\u010Dili s prevaro, \u0161e posebno, \u010De je (la\u017Ena) \u017Eival v tujini in vi naj bi pla\u010Dali \xBBSAMO\xAB za njeno dostavo.</li>', index: 11432},
    'mail_crm2.WeRecommendYouMeetTheSellerToSeeExistenceAndHealthOfAnimal': {value: 'Najprej in predvsem vam priporo\u010Damo, da se osebno sre\u010Date s prodajalcem, da bi se prepri\u010Dali o obstoju in dobrem zdravstvenem stanju \u017Eivali, ki je naprodaj. To je dale\u010D najbolj\u0161i in najvarnej\u0161i na\u010Din izvedbe transakcije.', index: 11433},
    'mail_crm2.WeSuggestYouSaveThisEmailYouWillFindUsefulInformation': {value: '<br /><span>Priporo\u010Damo, da si to sporo\u010Dilo shranite, saj so v njem koristne informacije v zvezi s kupovanjem na dra\u017Ebenih straneh in straneh z malimi oglasi.</span>', index: 11434},
    'mail_crm2.YouRecentlyRepliedToAnAdInTheAnimalCategoryOnBrand': {value: 'Nedavno ste prvi\u010D odgovorili na oglas v kategoriji \u017Divali na spletni strani OLX. Da bi vam pomagali uspe\u0161no opraviti va\u0161e iskanje in va\u0161o transakcijo, je tu nekaj priporo\u010Dil.', index: 11435},
