    'advertising.InstructionsAdWords01': {value: 'Za prodajo sponzoriranih povezav na spletni strani OLX je odgovoren Google. Sponzorirane povezave kupite tako, da kupite Google Adwords in jih ciljno usmerite na OLX. \u010Ce nimate ra\u010Duna za Google Adwords, ga lahko ustvarite na <<ADWORDSLINK>>Google Adwords<</ADWORDSLINK>>. \u010Ce ra\u010Dun \u017Ee imate,  uporabite spodnja navodila za ciljno usmerjanje va\u0161ih oglasov na OLX.', index: 11477},
