    'featured_listings.AdditionalTermsForFeaturedAds': {value: 'Dodatni pogoji za predstavljene oglase', index: 11495},
    'featured_listings.AdditionalTermsForFeaturedAds_content': {value: 'Ti dodatni pogoji, skupaj s <<LINK_TERMS_USE>>Pogoji uporabe<</LINK_TERMS_USE>> spletne strani, krijejo uporabo predstavljenih oglasov:<br /><ul><li>Kot potrdilo o pla\u010Dilu za predstavljeni oglas bo OLX izdal samo \xBBPotrdilo naro\u010Dila\xAB, ki ga boste videli na koncu pla\u010Dilnega postopka ter potrdilo po elektronski posti.</li><li>\u010Ce iz kakr\u0161negakoli vzroka, naj bo tehni\u010Dne ali kakr\u0161nekoli druge narave, va\u0161 oglas ni prikazan v razdelku \xBBPredstavljenih oglasov\xAB, je edina dol\u017Enost OLX, da va\u0161 oglas postavi v razdelek \xBBPredstavljenih oglasov\xAB, br\u017E ko bo to za nas izvedljivo.</li><li>Za nas izstavlja ra\u010Dune tretja stranka.</li><li>Po lastni presoji se lahko OLXodlo\u010Di, da kakr\u0161nikoli oglasi, ki so \u017Ealjivi, pornografski, vsiljena po\u0161ta (vklju\u010Dujo\u010D podvojene objave), mogo\u010De prevare ali ki bi lahko kr\u0161ili avtorske pravice, ne bodo predstavljeni in pla\u010Dilo ne bo povrnjeno/refundirano.</li><li>TA STORITEV ZA PREDSTAVLJENE OGLASE JE ZAGOTOVLJENA NA \xBBKOT JE\xAB ALI \xBBKOT RAZPOLO\u017DLJIVO\xAB OSNOVI, BREZ KAKR\u0160NIHKOLI GARANCIJ KAKR\u0160NEKOLI VRSTE V NAJVE\u010CJEM MOGO\u010CEM OBSEGU, DOVOLJENEM Z ZAKONOM.  OLX NE DAJE NOBENIH GARANCIJ ALI NAVEDB O TEM IN NE SPREJEMA NOBENEGA PORO\u0160TVA ALI ODGOVORNOSTI ZA NATAN\u010CNOST ALI POPOLNOST VSEBINE, OBJAVLJENE V STORITVI ZA PREDSTAVLJEN OGLAS.</li></ul>', index: 11496},
    'featured_listings.AdFeaturedHomepage_Wait': {value: 'Va\u0161 oglas je trenutno predstavljen na na\u0161i doma\u010Di strani. Oglas lahko predstavite v na\u0161ih objavah. Po\u010Dakajte, da pote\u010De obdobje predstave, preden ga spet predstavite na na\u0161i doma\u010Di strani.', index: 11497},
