    'featured_listings.AdsFeaturedGet20TimesMore': {value: 'Oglasi, ki so Objavljeni na na\u0161ih straneh imajo obi\u010Dajno 20krat ve\u010D ogledov in se prodajajo veliko hitreje kot obi\u010Dajni Oglasi.', index: 11499},
