    'featured_listings.StillHaveQuestions_content': {value: '\u010Ce imate \u0161e vedno vpra\u0161anja, pripombe ali predloge, lahko <<CONTACTLINK>>stopite v stik z na\u0161o skupino za podporo strankam<</CONTACTLINK>>.', index: 11574},
    'featured_listings.TermsAndConditions': {value: 'Dolo\u010Dbe in pogoji', index: 11575},
    'featured_listings.TermsOfService': {value: 'Pogoji storitve', index: 11576},
    'featured_listings.TermsOfService_content': {value: 'Ti pogoji storitve zajemajo uporabo predstavljenih objav in so dodatek k splo\u0161nim pogojem storitve.<br /><ul><li>Kot dokazilo pla\u010Dila predstavljenih objav bo OLX izdal le \xBBPotrditev naro\u010Dila\xAB, ki ga boste videli na koncu postopka pla\u010Dila, in elektronsko potrditev.</li><li>\u010Ce iz kakr\u0161nih koli razlogov, tehni\u010Dnih ali katerih koli drugih, va\u0161a objava ni prikazana v podro\u010Dju \xBBPredstavljene objave\xAB, je na\u0161a odgovornost le, da jo tja objavimo, takoj ko lahko.</li><li><<CLICK_AND_BUY_LINK>><<CLICK_AND_BUY>><</CLICK_AND_BUY_LINK>> zagotavlja na\u0161o re\u0161itev zara\u010Dunavanja.</li><li>Vsi podatki, ki jih pri tej storitvi zberemo, so varovani v skladu z na\u0161im pravilnikom o zasebnosti.</li><li>Objave, ki so \u017Ealjive, eroti\u010Dne, ne\u017Eelene, potencialno la\u017Ene ali kr\u0161ijo avtorske pravice, ne bodo objavljene.</li></ul>', index: 11577},
