    'featured_listings.UnableToFeature_NoImages_NoPrice': {value: 'Svoj Oglas lahko promovirate le, \u010De ste navedli ceno in vklju\u010Dili vsaj eno fotografijo. Prosimo, posodobite svoj Oglas. Vzelo vam bo le minuto \u010Dasa.', index: 11585},
    'featured_listings.UnableToFeature_NoImages_NoPrice_Outdated': {value: 'Va\u0161a objava je bila na spletu \u017Ee ve\u010D kot mesec dni, zato vas prosimo, da objavo posodobite, preden jo ponudite kot blagovno znamko na OLX. To bo trajalo samo minuto. Prav tako boste morali dolo\u010Diti ceno in dodati vsaj eno fotografijo, preden lahko reklamirate va\u0161 oglas.', index: 11586},
