    'featured_listings.WhyCantIModifyMyListing_content': {value: 'Obiskovalcem (ki so va\u0161 oglas morda shranili med zaznamke) \u017Eelimo zagotoviti bolj\u0161o izku\u0161njo, zato ne dovolimo spreminjanja predstavljenih oglasov, dokler ne pote\u010De mo\u017Enost predstavljenega oglasa.<br /><br />\u010Ce \u017Eelite svoje predstavljene oglase spremeniti, imate dve mo\u017Enosti:<br /><ul><li>Po\u010Dakajte, da pote\u010De mo\u017Enost predstavljenega oglasa, spremenite oglas in ponovno kupite mo\u017Enost predstavljenega oglasa; ali pa</li><li>pri zares pomembnih spremembah <<CONTACTLINK>>stopite v stik z na\u0161o skupino za podporo strankam<</CONTACTLINK>>.</li></ul>', index: 11597},
